navigator.getUserMedia = (navigator.getUserMedia || navigator.webkitGetUserMedia || navigator.mozGetUserMedia || navigator.msGetUserMedia);
if (navigator.getUserMedia === undefined) {
    alert('no getUserMedia');
}
window.AudioContext = (window.AudioContext || window.webkitAudioContext);
if (window.AudioContext === undefined) {
    alert('no AudioContext');
}
var autoDetectRenderer = PIXI.autoDetectRenderer, Container = PIXI.Container, Point = PIXI.Point;
var MovieClip = PIXI.extras.MovieClip;
var renderer = autoDetectRenderer(window.innerWidth, window.innerHeight, {
    view: document.getElementById('d'),
    transparent: true,
});
var PHANTOON_WIDTH = 500;
var PHANTOON_HEIGHT = 802;
var PHANTOON_BASE_WIGGLE = 0.16666666666666666666666666666667;
var phantoon = MovieClip.fromImages([
    'data:image/gif;base64,',
    'data:image/gif;base64,',
    'data:image/gif;base64,',
    'data:image/gif;base64,'
]);
phantoon.animationSpeed = 0;
phantoon.play();
var stage = new Container();
stage.addChild(phantoon);
animate();
function animate() {
    requestAnimationFrame(animate);
    renderer.render(stage);
}
window.addEventListener('resize', resize, false);
resize();
function resize() {
    var ratio = Math.min(window.innerWidth / PHANTOON_WIDTH, window.innerHeight / PHANTOON_HEIGHT);
    stage.scale.x = stage.scale.y = ratio;
    renderer.resize(Math.ceil(PHANTOON_WIDTH * ratio), Math.ceil(PHANTOON_HEIGHT * ratio));
}
var ctx = document.getElementById('c').getContext('2d');
var gradient = ctx.createLinearGradient(0, 0, 0, 130);
gradient.addColorStop(1, '#000000');
gradient.addColorStop(0.75, '#ff0000');
gradient.addColorStop(0.25, '#ffff00');
gradient.addColorStop(0, '#ffffff');
var stream, context, analyser, processor, array, microphone;
navigator.getUserMedia({
    audio: true
}, function (s) {
    stream = s;
    console.log(stream);
    context = new AudioContext;
    microphone = context.createMediaStreamSource(stream);
    analyser = context.createAnalyser();
    analyser.smoothingTimeConstant = 0.3;
    analyser.fftSize = 1024;
    processor = context.createScriptProcessor(2048, 1, 1);
    array = new Uint8Array(analyser.frequencyBinCount);
    processor.onaudioprocess = function () {
        analyser.getByteFrequencyData(array);
        var average = getAverageVolume(array);
        console.log(average);
        phantoon.animationSpeed = wigglesSpeedFunction(average);
        ctx.clearRect(0, 0, 60, 130);
        ctx.fillStyle = gradient;
        ctx.fillRect(0, 130 - average, 25, 130);
    };
    microphone.connect(analyser);
    analyser.connect(processor);
    processor.connect(context.destination);
}, function (err) {
    console.error(err);
});
function wigglesSpeedFunction(volume) {
    return (PHANTOON_BASE_WIGGLE * Math.pow(volume, 2)) / 800;
}
function getAverageVolume(arr) {
    var total = 0;
    var len = arr.length;
    for (var i = 0; i < len; i++) {
        total += arr[i];
    }
    return total / len;
}
